(16, 'Uzumaki Naruto', 'Năm 2050 Việt Nam vào TOP 10 nền nông nghiệp xanh, hiện đại nhất thế giới', 'nam-2050-viet-nam-vao-top-10-nen-nong-nghiep-xanh-hien-dai-nhat-the-gioi', '4ce18884d8.jpeg', '<p><span style=\"font-size:16px\">Đ&oacute; l&agrave; mục ti&ecirc;u tổng qu&aacute;t trong&nbsp;<a href=\"https://thanhnien.vn/bo-truong-le-minh-hoan-huong-toi-nen-nong-nghiep-lay-gia-tri-lam-muc-tieu-post1406756.html\" title=\"Bộ trưởng Lê Minh Hoan: Hướng tới nền nông nghiệp lấy giá trị làm mục tiêu\">chiến lược ph&aacute;t triển n&ocirc;ng nghiệp v&agrave; n&ocirc;ng th&ocirc;n bền vững giai đoạn 2021 - 2030</a>, tầm nh&igrave;n đến năm 2050 vừa được Ph&oacute; thủ tướng L&ecirc; Văn Th&agrave;nh k&yacute; quyết định ph&ecirc; duyệt v&agrave; ban h&agrave;nh.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Theo chiến lược n&agrave;y, n&ocirc;ng nghiệp Việt Nam hiện đ&atilde; bước sang giai đoạn mới trong bối cảnh tốc độ đ&ocirc; thị h&oacute;a diễn tiến rất nhanh, hội nhập quốc tế mạnh mẽ. Biến đổi kh&iacute; hậu đang diễn biến phức tạp, ảnh hưởng nghi&ecirc;m trọng đến sản xuất n&ocirc;ng nghiệp trong nước cũng như thị trường to&agrave;n cầu.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Theo đ&oacute;, ng&agrave;nh n&ocirc;ng nghiệp cần c&oacute; chiến lược mới với tầm nh&igrave;n bao qu&aacute;t d&agrave;i hạn trong nhiều năm tới.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Việt Nam phấn đấu đến năm 2050 sẽ nằm trong TOP 10 quốc gia có nền nông nghiệp xanh, hiện đại nhất thế giới\" src=\"ckeditor/htx-5639.jpeg\" style=\"height:637px; width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Việt Nam phấn đấu đến năm 2050 sẽ nằm trong TOP 10 quốc gia c&oacute; nền n&ocirc;ng nghiệp xanh, hiện đại nhất thế giới</p>\r\n\r\n			<div class=\"source\">\r\n			<p>CTV</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><cite>Chiến lược đặt mục ti&ecirc;u cụ thể đến năm 2030, tốc độ tăng trưởng GDP n&ocirc;ng l&acirc;m thủy sản đạt b&igrave;nh qu&acirc;n từ 2,5 - 3%/năm, tốc độ tăng năng suất lao động n&ocirc;ng l&acirc;m thủy sản đạt b&igrave;nh qu&acirc;n từ 5,5 - 6%/năm; mở rộng v&agrave; ph&aacute;t triển thị trường, nhất l&agrave; thị trường xuất khẩu. Tốc độ tăng gi&aacute; trị&nbsp;<a href=\"https://thanhnien.vn/nong-san-viet-nam-phai-duoc-dat-hang-chu-khong-phai-cho-giai-cuu-post1422719.html\" title=\"‘Nông sản Việt Nam phải được đặt hàng chứ không phải chờ giải cứu’\">xuất khẩu n&ocirc;ng l&acirc;m thủy</a>&nbsp;sản đạt b&igrave;nh qu&acirc;n từ 5 - 6%/năm.</cite></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Chiến lược n&agrave;y cũng đặt mục ti&ecirc;u phải n&acirc;ng cao thu nhập người d&acirc;n, giảm ngh&egrave;o bền vững. Thu nhập của cư d&acirc;n n&ocirc;ng th&ocirc;n cao hơn 2,5 - 3 lần so với năm 2020. Tỷ lệ hộ ngh&egrave;o đa chiều ở n&ocirc;ng th&ocirc;n giảm b&igrave;nh qu&acirc;n 1 - 1,5%/năm. Tỷ trọng lao động n&ocirc;ng nghiệp trong tổng lao động x&atilde; hội giảm xuống dưới 20%, tỷ lệ lao động n&ocirc;ng nghiệp được đ&agrave;o tạo đạt tr&ecirc;n 70%; cả nước c&oacute; &iacute;t nhất 90% số x&atilde; đạt chuẩn n&ocirc;ng th&ocirc;n mới, trong đ&oacute; 50% số x&atilde; đạt chuẩn&nbsp;<a href=\"https://thanhnien.vn/gop-suc-tre-xay-dung-dat-nuoc-post1427311.html\" title=\"Góp sức trẻ xây dựng đất nước\">n&ocirc;ng th&ocirc;n mới</a>&nbsp;n&acirc;ng cao.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Để th&iacute;ch ứng với biến đổi kh&iacute; hậu, chiến lược n&agrave;y cũng đặt mục ti&ecirc;u ph&aacute;t triển nền n&ocirc;ng nghiệp Việt Nam từ nay đến năm 2030 phải xử l&yacute; tốt vấn đề&nbsp;<a href=\"https://thanhnien.vn/o-nhiem-moi-truong-chuyen-dich-ve-nong-thon-post480751.html\" title=\"Ô nhiễm môi trường chuyển dịch về nông thôn\">&ocirc; nhiễm m&ocirc;i trường n&ocirc;ng th&ocirc;n</a>, đ&oacute;ng g&oacute;p v&agrave;o thực hiện cam kết giảm ph&aacute;t thải kh&iacute; nh&agrave; k&iacute;nh do c&aacute;c quốc gia tự quyết định, phấn đấu giảm ph&aacute;t thải kh&iacute; nh&agrave; k&iacute;nh 10% so với năm 2020.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">B&ecirc;n cạnh đ&oacute;, nội dung Chiến lược cũng x&aacute;c định tầm nh&igrave;n đến năm 2050 phấn đấu đưa Việt Nam trở th&agrave;nh 1/10 quốc gia c&oacute; nền n&ocirc;ng nghiệp ph&aacute;t triển nhất thế giới. N&ocirc;ng nghiệp Việt Nam phải l&agrave; nền n&ocirc;ng nghiệp xanh,&nbsp;<a href=\"https://thanhnien.vn/chuyen-doi-so-la-chia-khoa-de-vinh-phuc-xay-dung-nen-nong-nghiep-thong-minh-post1415764.html\" title=\"Chuyển đổi số là chìa khoá để Vĩnh phúc xây dựng nền nông nghiệp thông minh\">n&ocirc;ng nghiệp th&ocirc;ng minh</a>&nbsp;c&oacute; ứng dụng khoa học, c&ocirc;ng nghệ hiện đại; kết nối chặt chẽ v&agrave; h&agrave;i h&ograve;a với đ&ocirc; thị, n&acirc;ng cao thu nhập, đời sống của người d&acirc;n n&ocirc;ng th&ocirc;n tiệm cận với đ&ocirc; thị, kh&ocirc;ng c&ograve;n hộ ngh&egrave;o.</span></p>\r\n', 0, 'sNông nghiệp Việt Nam', '<p><strong>Chiến lược ph&aacute;t triển n&ocirc;ng nghiệp v&agrave; n&ocirc;ng th&ocirc;n bền vững giai đoạn 2021 - 2030, tầm nh&igrave;n đến năm 2050 đặt mục ti&ecirc;u Việt Nam nằm trong TOP 10 nền&nbsp;<a href=\"https://thanhnien.vn/loat-du-an-nong-nghiep-xanh-nang-luong-sach-nghin-ti-dong-do-ve-dak-lak-post1045733.html\" title=\"Loạt dự án nông nghiệp xanh, năng lượng sạch nghìn tỉ đồng đổ về Đắk Lắk\">n&ocirc;ng nghiệp xanh</a>, n&ocirc;ng nghiệp ứng dụng&nbsp;<a href=\"https://thanhnien.vn/cong-nghe/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"công nghệ\">c&ocirc;ng nghệ</a>&nbsp;cao hiện đại nhất thế giới.</strong></p>\r\n', 55, 1, '2022-02-08 02:19:00', '2022-02-08 02:19:00'),
(17, 'Uzumaki Naruto', 'Ban hành hệ thống giám sát đánh giá thích ứng với biến đổi khí hậu', 'ban-hanh-he-thong-giam-sat-danh-gia-thich-ung-voi-bien-doi-khi-hau', '4a6d4b7360.jpg', '<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Mưa lớn bất thường từng gây ngập lụt khu phố cổ Hà Nội\" src=\"http://localhost/Projec%20PHP%20thu%E1%BA%A7n/Admin/ckeditor/Tulips.jpg\" style=\"height:637px; width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Mưa lớn bất thường từng g&acirc;y ngập lụt khu phố cổ H&agrave; Nội</p>\r\n\r\n			<div class=\"source\">\r\n			<p>L&ecirc; qu&acirc;n</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Cụ thể, tại Quyết định số 148/QĐ-TTg ban h&agrave;nh Hệ thống gi&aacute;m s&aacute;t đ&aacute;nh gi&aacute; hoạt động th&iacute;ch ứng với&nbsp;<a href=\"https://thanhnien.vn/su-song-tren-trai-dat-dang-dan-can-kiet-post1424686.html\" title=\"Sự sống trên Trái Đất đang dần cạn kiệt\">biến đổi kh&iacute; hậu</a>&nbsp;cấp quốc gia, Ch&iacute;nh phủ đặt ra y&ecirc;u cầu về việc thiết lập v&agrave; vận h&agrave;nh hệ thống n&agrave;y. Hệ thống sẽ cung cấp cơ sở cho việc quản l&yacute;, điều phối v&agrave; n&acirc;ng cao hiệu quả thực hiện c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu v&agrave; c&ocirc;ng t&aacute;c quản l&yacute; nh&agrave; nước về biến đổi kh&iacute; hậu.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Bộ TN-MT cho biết nội dung gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; về c&ocirc;ng t&aacute;c quản l&yacute; nh&agrave; nước về biến đổi kh&iacute; hậu sẽ ch&uacute; &yacute; đến ho&agrave;n thiện thể chế, ch&iacute;nh s&aacute;ch; x&acirc;y dựng v&agrave; ban h&agrave;nh chiến lược, quy hoạch, kế hoạch, chương tr&igrave;nh, đề &aacute;n, dự &aacute;n; x&acirc;y dựng v&agrave; ban h&agrave;nh ti&ecirc;u chuẩn, quy chuẩn kỹ thuật quốc gia, quy định, hướng dẫn kỹ thuật; x&acirc;y dựng b&aacute;o c&aacute;o về th&iacute;ch ứng với biến đổi kh&iacute; hậu&hellip;</span></p>\r\n\r\n<p><span style=\"font-size:16px\">B&ecirc;n cạnh đ&oacute;, sẽ ch&uacute; &yacute; đến việc tăng cường khả năng chống chịu, năng lực th&iacute;ch ứng với biến đổi kh&iacute; hậu trong c&aacute;c lĩnh vực: n&ocirc;ng nghiệp, l&acirc;m nghiệp, thủy sản; m&ocirc;i trường v&agrave;&nbsp;<a href=\"https://thanhnien.vn/phat-hien-nhieu-loai-thu-chim-quy-hiem-o-vuon-quoc-gia-chu-yang-sin-post1418682.html\" title=\"Phát hiện nhiều loài thú, chim quý hiếm ở Vườn quốc gia Chư Yang Sin\">đa dạng sinh học</a>; t&agrave;i nguy&ecirc;n nước; giao th&ocirc;ng vận tải; x&acirc;y dựng, đ&ocirc; thị; c&ocirc;ng nghiệp, thương mại v&agrave; dịch vụ; y tế v&agrave;&nbsp;<a href=\"https://thanhnien.vn/suc-khoe/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"sức khỏe cộng đồng\">sức khỏe cộng đồng</a>; lao động, x&atilde; hội; văn h&oacute;a, thể thao, du lịch.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Nội dung gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; về giảm nhẹ rủi ro thi&ecirc;n tai, giảm thiểu thiệt hại do biến đổi kh&iacute; hậu gồm: quan trắc kh&iacute; tượng thủy văn; gi&aacute;m s&aacute;t biến đổi kh&iacute; hậu, nước biển d&acirc;ng v&agrave; x&acirc;m nhập mặn; quản l&yacute; rủi ro thi&ecirc;n tai...</span></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Cơ sở dữ liệu gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; được x&acirc;y dựng v&agrave; vận h&agrave;nh trực tuyến, bảo đảm an to&agrave;n th&ocirc;ng tin, bao gồm: th&ocirc;ng tin về tiến độ, kết quả thực hiện c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu; b&aacute;o c&aacute;o gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; của c&aacute;c bộ, cơ quan ngang bộ, UBND cấp tỉnh; c&aacute;c th&ocirc;ng tin kh&aacute;c c&oacute; li&ecirc;n quan; phần mềm quản l&yacute; cơ sở dữ liệu.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Với vai tr&ograve; l&agrave; cơ quan đầu mối của hệ thống, Bộ TN-MT c&oacute; tr&aacute;ch nhiệm chủ tr&igrave;, phối hợp với c&aacute;c bộ, cơ quan ngang bộ, UBND cấp tỉnh tổ chức thực hiện gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; c&aacute;c&nbsp;<a href=\"https://thanhnien.vn/dong-bang-song-cuu-long-nen-san-xuat-it-gao-hon-post859593.html\" title=\"Đồng bằng sông Cửu Long nên sản xuất ít gạo hơn\">hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu</a>&nbsp;trong phạm vi quản l&yacute;; x&acirc;y dựng v&agrave; quản l&yacute; cơ sở dữ liệu về gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu đảm bảo cung cấp, chia sẻ th&ocirc;ng&nbsp;<a href=\"https://thanhnien.vn/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"tin cập nhật\">tin cập nhật</a>&nbsp;về tiến độ, kết quả thực hiện c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu;...</span></p>\r\n\r\n<p><span style=\"font-size:16px\">C&aacute;c bộ, cơ quan ngang bộ, UBND cấp tỉnh c&oacute; tr&aacute;ch nhiệm tổ chức gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu thuộc phạm vi quản l&yacute;; cập nhật th&ocirc;ng tin về tiến độ, kết quả thực hiện c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu v&agrave;o cơ sở dữ liệu của hệ thống gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute;; b&aacute;o c&aacute;o tổng hợp kết quả gi&aacute;m s&aacute;t, đ&aacute;nh gi&aacute; trước 25.12 hằng năm.</span></p>\r\n', 0, 'Ban hành hệ thống giám sát đánh giá thích ứng với biến đổi khí hậu\r\n', '<p><span style=\"font-size:16px\"><strong>Ch&iacute;nh phủ vừa ban h&agrave;nh hệ thống gi&aacute;m s&aacute;t đ&aacute;nh gi&aacute; hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu cấp quốc gia v&agrave; giao&nbsp;<a href=\"https://thanhnien.vn/tin-tuc-thoi-tiet-hom-nay-8-2-2022-bac-bo-ret-dam-ret-hai-post1427597.html\" title=\"Tin tức thời tiết hôm nay, 8.2.2022 : Bắc bộ rét đậm, rét hại\">Bộ TN-MT&nbsp;</a>l&agrave;m&nbsp;cơ quan đầu mối thực thi.&nbsp;</strong></span></p>\r\n', 55, 1, '2022-02-08 04:38:47', '2023-01-09 08:04:47'),
(18, 'Uzumaki Naruto', 'Hàng không, du lịch bứt tốc', 'hang-khong-du-lich-but-toc', 'fc2c05adfa.jpg', '<p><span style=\"font-size:16px\">Mạng bay quốc nội mở hết cỡ, nhiều&nbsp;<a href=\"https://thanhnien.vn/tang-tan-suat-nhieu-duong-bay-quoc-te-mo-them-duong-bay-den-chau-au-post1421042.html\" title=\"Tăng tần suất nhiều đường bay quốc tế, mở thêm đường bay đến châu Âu\">đường bay quốc tế</a>&nbsp;được nối lại, từng đo&agrave;n du kh&aacute;ch x&oacute;a tan sự ảm đạm tại h&agrave;ng ng&agrave;n khu nghỉ dưỡng..., những bước đệm quan trọng từ m&ugrave;a cao điểm Tết Nguy&ecirc;n đ&aacute;n đang tạo đ&agrave; cho một năm mới bứt tốc của h&agrave;ng kh&ocirc;ng v&agrave;&nbsp;<a href=\"https://thanhnien.vn/du-lich/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"du lịch Việt Nam\">du lịch Việt Nam</a>.</span></p>\r\n\r\n<h2><strong>Dồn dập mở cửa bầu trời</strong></h2>\r\n\r\n<p><span style=\"font-size:16px\">3 ng&agrave;y trước&nbsp;<a href=\"https://thanhnien.vn/uoc-vong-ben-chuyen-tau-tro-lai-thanh-pho-sau-tet-nguyen-dan-post1427191.html\" title=\"Ước vọng bên chuyến tàu trở lại thành phố sau Tết nguyên đán \">Tết Nguy&ecirc;n đ&aacute;n&nbsp;</a>Nh&acirc;m Dần 2022, Văn ph&ograve;ng Ch&iacute;nh phủ th&ocirc;ng b&aacute;o &yacute; kiến của Ph&oacute; thủ tướng thường trực Phạm B&igrave;nh Minh đồng &yacute; chủ trương tăng tần suất chuyến bay thương mại quốc tế thường lệ chở kh&aacute;ch đến c&aacute;c địa b&agrave;n như Nhật Bản, H&agrave;n Quốc, Đ&agrave;i Loan v&agrave; mở rộng địa b&agrave;n &aacute;p dụng giai đoạn th&iacute; điểm tới ch&acirc;u &Acirc;u, &Uacute;c để đ&aacute;p ứng nhu cầu về nước của&nbsp;<a href=\"https://thanhnien.vn/the-gioi/nguoi-viet-nam-chau/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"người Việt\">người Việt</a>&nbsp;ở nước ngo&agrave;i nh&acirc;n dịp Tết Nguy&ecirc;n đ&aacute;n như đề xuất của Bộ GTVT. Hai ng&agrave;y sau, ng&agrave;y cuối c&ugrave;ng của năm T&acirc;n Sửu 2021,&nbsp;<a href=\"https://thanhnien.vn/thu-tuong-chinh-phu/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Thủ tướng Chính phủ\">Thủ tướng Ch&iacute;nh phủ</a>&nbsp;tiếp tục chỉ đạo Bộ GTVT sớm đưa c&ocirc;ng d&acirc;n Việt Nam mắc kẹt về nước trong l&uacute;c chuyến bay thương mại chưa kh&ocirc;i phục ho&agrave;n to&agrave;n. Lập tức, Bộ GTVT đ&atilde; cho ph&eacute;p Cục H&agrave;ng kh&ocirc;ng cấp ph&eacute;p ngay c&aacute;c chuyến bay thường lệ v&agrave; kh&ocirc;ng thường lệ m&agrave; kh&ocirc;ng y&ecirc;u cầu bất kỳ văn bản x&eacute;t duyệt về nh&acirc;n sự n&agrave;o. Đồng thời c&ocirc;ng d&acirc;n Việt Nam về nước tr&ecirc;n c&aacute;c chuyến bay kh&ocirc;ng bị hạn chế nhập cảnh.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Lượng khách đi máy bay tăng mạnh dịp Tết Nguyên đán Nhâm Dần 2022\" src=\"ckeditor/01-7010.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Lượng kh&aacute;ch đi m&aacute;y bay tăng mạnh dịp Tết Nguy&ecirc;n đ&aacute;n Nh&acirc;m Dần 2022</p>\r\n\r\n			<div class=\"source\">\r\n			<p>ĐẬU TIẾN ĐẠT</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Cụ thể, tại Quyết định số 148/QĐ-TTg ban h&agrave;nh Hệ thống gi&aacute;m s&aacute;t đ&aacute;nh gi&aacute; hoạt động th&iacute;ch ứng với&nbsp;<a href=\"https://thanhnien.vn/su-song-tren-trai-dat-dang-dan-can-kiet-post1424686.html\" title=\"Sự sống trên Trái Đất đang dần cạn kiệt\">biến đổi kh&iacute; hậu</a>&nbsp;cấp quốc gia, Ch&iacute;nh phủ đặt ra y&ecirc;u cầu về việc thiết lập v&agrave; vận h&agrave;nh hệ thống n&agrave;y. Hệ thống sẽ cung cấp cơ sở cho việc quản l&yacute;, điều phối v&agrave; n&acirc;ng cao hiệu quả thực hiện c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu v&agrave; c&ocirc;ng t&aacute;c quản l&yacute; nh&agrave; nước về biến đổi kh&iacute; hậu.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">H&agrave;ng loạt r&agrave;o cản được th&aacute;o gỡ trước thềm Tết Nguy&ecirc;n đ&aacute;n đ&atilde; mở đường cho những chuyến bay quốc tế đua nhau về Việt Nam. Trước đ&oacute;, Vietnam Airlines thực hiện 2 chuyến bay đầu ti&ecirc;n ch&iacute;nh thức nối lại c&aacute;c đường bay thường lệ giữa ch&acirc;u &Acirc;u v&agrave; Việt Nam sau gần 2 năm gi&aacute;n đoạn v&igrave; dịch Covid-19. Chuyến bay chở 190 h&agrave;nh kh&aacute;ch từ Frankfurt (Đức) v&agrave; gần 300 h&agrave;nh kh&aacute;ch h&agrave;nh tr&igrave;nh London - Paris đ&atilde; lần lượt hạ c&aacute;nh an to&agrave;n tại s&acirc;n bay quốc tế Nội B&agrave;i (H&agrave; Nội) s&aacute;ng 26.1. Sau 2 h&agrave;nh tr&igrave;nh n&agrave;y, Vietnam Airlines đ&atilde; kh&ocirc;i phục hoạt động vận tải h&agrave;nh kh&aacute;ch thường lệ tại 12 quốc gia v&agrave; v&ugrave;ng l&atilde;nh thổ, đ&aacute;nh dấu giai đoạn mở cửa h&agrave;ng kh&ocirc;ng quốc tế thường lệ, kh&ocirc;i phục cầu nối h&agrave;ng kh&ocirc;ng Việt Nam với&nbsp;<a href=\"https://thanhnien.vn/the-gioi/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"thế giới\">thế giới</a>&nbsp;sau đại dịch.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Bamboo Airways cũng ch&iacute;nh thức c&ocirc;ng bố đường bay thẳng Việt Nam - Đức v&agrave; ra mắt tổng đại l&yacute; tại thị trường Đức, sau khi tăng cường nhiều đường bay thường lệ đi ch&acirc;u &Aacute;, ch&acirc;u &Acirc;u, &Uacute;c. Theo kế hoạch, Bamboo Airways dự kiến khai th&aacute;c đường bay thường lệ khứ hồi kết nối H&agrave; Nội - Frankfurt từ ng&agrave;y 25.2, với tần suất ban đầu 2 chuyến khứ hồi/tuần.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Kh&ocirc;ng nằm ngo&agrave;i đường đua, H&atilde;ng h&agrave;ng kh&ocirc;ng&nbsp;<a href=\"https://thanhnien.vn/vietjet/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Vietjet\">Vietjet</a>&nbsp;kh&ocirc;i phục th&ecirc;m đường bay kết nối TP.HCM với Bangkok (Th&aacute;i Lan) từ 21.1. C&aacute;c chuyến bay thương mại quốc tế giữa H&agrave; Nội/TP.HCM - Tokyo, Đ&agrave;i Bắc, Seoul v&agrave;&nbsp;<a href=\"https://thanhnien.vn/singapore/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Singapore\">Singapore</a>&nbsp;đ&atilde; được h&atilde;ng n&agrave;y khai th&aacute;c ngay từ 1.1. Đại diện Vietjet dự kiến giai đoạn tiếp theo sẽ mở lại to&agrave;n bộ c&aacute;c đường bay quốc tế đ&atilde; khai th&aacute;c trước đ&acirc;y v&agrave; mở th&ecirc;m c&aacute;c đường bay xa hơn đến Ấn Độ, Nga...</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Trong nước, thị trường nội địa cũng n&oacute;ng l&ecirc;n từng ng&agrave;y. Giai đoạn cận tết, lượng kh&aacute;ch mua v&eacute; m&aacute;y bay tăng cao tr&ecirc;n tất cả nh&oacute;m h&agrave;nh tr&igrave;nh, đặc biệt l&agrave; khi Bộ GTVT bỏ quy định x&eacute;t nghiệm v&agrave; kiểm so&aacute;t ti&ecirc;m chủng vắc xin Covid-19 đối với h&agrave;nh kh&aacute;ch. Tất cả c&aacute;c h&atilde;ng h&agrave;ng kh&ocirc;ng đều mở bung mạng bay nội địa, tăng tần suất c&aacute;c đường bay &ldquo;hot&rdquo; để phục vụ tối đa nhu cầu về qu&ecirc;, du lịch của h&agrave;nh kh&aacute;ch. T&acirc;n binh Vietravel Airlines cũng nhanh ch&oacute;ng đ&oacute;n cơ hội mở rộng mạng đường bay mới nối TP.HCM với Quy Nhơn (B&igrave;nh Định), đồng thời kh&ocirc;i phục đường bay đến Đ&agrave; Nẵng, đ&aacute;nh dấu bước chuyển m&igrave;nh t&iacute;ch cực sau thời gian &ldquo;ngủ đ&ocirc;ng chủ động&rdquo; do ảnh hưởng của&nbsp;<a href=\"https://thanhnien.vn/covid-19/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Covid-19\">Covid-19</a>.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">&Ocirc;ng Đặng Anh Tuấn, Trưởng ban Truyền th&ocirc;ng Vietnam Airlines, đ&aacute;nh gi&aacute; b&ecirc;n cạnh tiến độ ti&ecirc;m chủng v&agrave; t&igrave;nh h&igrave;nh kiểm so&aacute;t dịch bệnh đang ng&agrave;y c&agrave;ng t&iacute;ch cực tr&ecirc;n thế giới, nhu cầu du lịch, c&ocirc;ng vụ bị k&igrave;m n&eacute;n trong 2 năm đại dịch l&agrave; một trong những yếu tố quan trọng mang đến cơ hội cho sự phục hồi của h&agrave;ng kh&ocirc;ng. Điều đ&oacute; được minh chứng r&otilde; trong giai đoạn từ 1 - 24.1, khi Vietnam Airlines kh&ocirc;i phục bay thường lệ tới 8 quốc gia, v&ugrave;ng l&atilde;nh thổ v&agrave; ghi nhận tỷ lệ lấp đầy c&aacute;c chuyến bay đến Việt Nam gần 70% trong giai đoạn n&agrave;y. Hay như cao điểm tết, c&aacute;c chuyến bay nội địa từ ph&iacute;a nam ra miền Bắc v&agrave; miền Trung đạt tỷ lệ lấp đầy cao, trung b&igrave;nh 94 - 97%, nhiều chuyến đạt 100%.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">&ldquo;Khả năng phục hồi của thị trường h&agrave;ng kh&ocirc;ng Việt Nam dự kiến cũng sẽ theo diễn tiến chung của khu vực v&agrave; thế giới. Ở kịch bản lạc quan - Việt Nam ho&agrave;n th&agrave;nh việc ti&ecirc;m chủng to&agrave;n d&acirc;n trong qu&yacute; 1/2022, dịch kh&ocirc;ng b&ugrave;ng ph&aacute;t trong nước, Ch&iacute;nh phủ bỏ c&aacute;c hạn chế nhập cảnh v&agrave; nới lỏng quy định c&aacute;ch ly - ch&uacute;ng ta sẽ c&oacute; tốc độ phục hồi nhanh. Dự b&aacute;o kh&aacute;ch tổng thị trường quốc tế đạt 52% so với năm 2019, kh&aacute;ch tổng thị trường nội địa sẽ đạt 88%&rdquo;, &ocirc;ng Tuấn th&ocirc;ng tin.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Du khách trong và ngoài nước du xuân Hội An tết năm nay\" src=\"ckeditor/02-9010.jpg\" style=\"height:637px; width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Du kh&aacute;ch trong v&agrave; ngo&agrave;i nước du xu&acirc;n Hội An tết năm nay</p>\r\n\r\n			<div class=\"source\">\r\n			<p>NGUYỄN T&Uacute;</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 0, 'Hàng không, du lịch,Vietravel Holdings,Đường bay,Ban Truyền thông Vietnam Airlines,Nguyễn Quốc Kỳ,Hà Nội/TP,Ngủ đông,Thương mại quốc tế,Bamboo Airways,Chuyến bay', '<p><strong>H&agrave;ng kh&ocirc;ng tăng tốc, du lịch cũng bắt đầu trở m&igrave;nh sau kỳ &ldquo;ngủ đ&ocirc;ng&rdquo; chưa từng c&oacute; trong lịch sử.</strong></p>\r\n', 56, 1, '2022-02-08 04:55:22', '2022-02-08 04:55:22'),
(19, 'Uzumaki Naruto', '\'Choáng\' với giá vé máy bay về TP.HCM, cao gấp 5 lần trước tết', 'choang-voi-gia-ve-may-bay-ve-tphcm-cao-gap-5-lan-truoc-tet', 'f38bb08e78.jpg', '<p><span style=\"font-size:16px\">Nhiều người d&acirc;n c&oacute; nhu cầu mua v&eacute; m&aacute;y bay trở về TP.HCM sau Tết Nguy&ecirc;n đ&aacute;n &quot;cho&aacute;ng&quot; khi thấy bảng b&aacute;o gi&aacute; v&eacute; h&ocirc;m nay (5.2 - tức m&ugrave;ng 5 &acirc;m lịch) v&agrave; ng&agrave;y mai (6.2).</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Hành khách đi máy bay chuyến Hà Nội - TP.HCM tại sân bay Nội Bài, ngày cuối năm 2021\" src=\"ckeditor/hanh-khach-di-may-bay-chuyen-ha-noi-tp-hcm-tai-san-bay-noi-bai-ngay-30-12-2021-dau-tien-dat-3-6410.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>H&agrave;nh kh&aacute;ch đi m&aacute;y bay chuyến H&agrave; Nội - TP.HCM tại s&acirc;n bay Nội B&agrave;i, ng&agrave;y cuối năm 2021</p>\r\n\r\n			<div class=\"source\">\r\n			<p>ĐẬU TIẾN ĐẠT</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Cụ thể, tại Quyết định số 148/QĐ-TTg ban h&agrave;nh Hệ thống gi&aacute;m s&aacute;t đ&aacute;nh gi&aacute; hoạt động th&iacute;ch ứng với&nbsp;<a href=\"https://thanhnien.vn/su-song-tren-trai-dat-dang-dan-can-kiet-post1424686.html\" title=\"Sự sống trên Trái Đất đang dần cạn kiệt\">biến đổi kh&iacute; hậu</a>&nbsp;cấp quốc gia, Ch&iacute;nh phủ đặt ra y&ecirc;u cầu về việc thiết lập v&agrave; vận h&agrave;nh hệ thống n&agrave;y. Hệ thống sẽ cung cấp cơ sở cho việc quản l&yacute;, điều phối v&agrave; n&acirc;ng cao hiệu quả thực hiện c&aacute;c hoạt động th&iacute;ch ứng với biến đổi kh&iacute; hậu v&agrave; c&ocirc;ng t&aacute;c quản l&yacute; nh&agrave; nước về biến đổi kh&iacute; hậu.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:16px\">Tr&ecirc;n trang web của H&atilde;ng h&agrave;ng kh&ocirc;ng quốc gia Vietnam Airlines, to&agrave;n bộ v&eacute; c&aacute;c hạng phổ th&ocirc;ng, phổ th&ocirc;ng linh hoạt tr&ecirc;n khoảng 20 chuyến bay chặng H&agrave; Nội - TP.HCM ng&agrave;y 5.2 đều đ&atilde; b&aacute;o hết, chỉ c&ograve;n v&eacute; hạng thương gia với gi&aacute; thấp nhất gần 8,7 triệu đồng/chiều, cao nhất hơn 10 triệu đồng/chiều. Một số chuyến bay tối muộn cũng c&oacute; gi&aacute; hơn 9,6 triệu đồng/chiều.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Tương tự, những ng&agrave;y tiếp theo (m&ugrave;ng 6, 7, 8), c&aacute;c dải gi&aacute; v&eacute; phổ th&ocirc;ng, phổ th&ocirc;ng linh hoạt cũng đ&atilde; &quot;bay m&agrave;u&quot;, chỉ c&ograve;n lại v&eacute; hạng thương gia với mức gi&aacute; dao động từ 8,7 - hơn 10 triệu đồng/chiều. Phải tới ng&agrave;y 9.2, h&agrave;nh kh&aacute;ch mới c&oacute; cơ hội mua v&eacute; của Vietnam Airlines từ H&agrave; Nội v&agrave;o TP.HCM với tr&ecirc;n một số chặng với gi&aacute; hạng phổ th&ocirc;ng ở mức gần chạm trần - hơn 3,5 triệu đồng/chiều.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Sau đ&oacute;, từ ng&agrave;y 12.2 trở đi, v&eacute; m&aacute;y bay chặng n&agrave;y lại hạ nhiệt xuống khoảng 800.000 đồng/chiều, v&eacute; nhiều &ecirc; hề.</span></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Tham khảo tr&ecirc;n trang b&aacute;n v&eacute; m&aacute;y bay trực tuyến Abay, to&agrave;n bộ c&aacute;c chuyến bay của&nbsp;<a href=\"https://thanhnien.vn/vietjet/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Vietjet\">Vietjet</a>, Pacific Airlines, Vietravel Airlines bay chặng H&agrave; Nội - TP.HCM đều đ&atilde; hết v&eacute;. Ngo&agrave;i Vietnam Airlines, chỉ c&ograve;n số &iacute;t chuyến bay của h&atilde;ng Bamboo Airways c&ograve;n chỗ, gi&aacute; hơn 7,5 triệu đồng/chiều. Cũng phải tới 9.2, tr&ecirc;n Abay mới hiện lại c&aacute;c chuyến bay của những h&atilde;ng h&agrave;ng kh&ocirc;ng c&ograve;n lại với dải gi&aacute; v&eacute; rộng, chỉ từ hơn 800.000 đồng/chiều.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">&quot;Trước tết, t&ocirc;i mua v&eacute; khứ hồi chặng TP.HCM - H&agrave; Nội cho gia đ&igrave;nh 4 người hết tổng cộng 19,5 triệu đồng, bay Vietnam Airlines. Bay ng&agrave;y cao điểm ra H&agrave; Nội 26 &acirc;m lịch, bay v&agrave;o ng&agrave;y 6.2 m&agrave; t&iacute;nh ra chỉ hơn 2,4 triệu đồng/chiều. May sắp xếp t&iacute;nh to&aacute;n mua sớm chứ để giờ mới mua, v&eacute; cao thế n&agrave;y th&igrave; mất mấy chục triệu tiền v&eacute;&quot; - chị Trần Anh (ngụ TP.HCM) thở ph&agrave;o.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Gi&aacute; v&eacute; kh&ocirc;ng chỉ tăng vọt, một số chặng ngắn hơn từ&nbsp;<a href=\"https://thanhnien.vn/da-nang/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Đà Nẵng\">Đ&agrave; Nẵng</a>, Nha Trang, Huế, Thanh H&oacute;a về tới TP.HCM đều đ&atilde; b&aacute;o hết v&eacute; tất cả c&aacute;c h&atilde;ng từ h&ocirc;m nay cho tới 8.2. Phải tới 9.2, chặng Đ&agrave; Nẵng - TP.HCM mới c&oacute; chuyến bay của Bamboo Airways v&agrave; Vietnam Airlines c&ograve;n chỗ trống, gi&aacute; v&eacute; thấp nhất hơn 4,5 triệu đồng/chiều. Những ng&agrave;y sau đ&oacute;, gi&aacute; v&eacute; lại giảm mạnh xuống c&ograve;n dưới 1 triệu đồng/chiều.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Theo ghi nhận của c&aacute;c h&atilde;ng h&agrave;ng kh&ocirc;ng, giai đoạn cận Tết Nguy&ecirc;n đ&aacute;n, lượng kh&aacute;ch mua v&eacute; m&aacute;y bay tăng cao tr&ecirc;n tất cả nh&oacute;m đường, đặc biệt l&agrave; khi Bộ GTVT bỏ quy định x&eacute;t nghiệm v&agrave; kiểm so&aacute;t ti&ecirc;m chủng đối với h&agrave;nh kh&aacute;ch. C&aacute;c chuyến bay nội địa từ ph&iacute;a nam ra miền Bắc v&agrave; miền Trung đạt tỷ lệ lấp đầy cao, trung b&igrave;nh 94 - 97%, nhiều chuyến đạt 100%.</span></p>\r\n', 0, 'vé máy bay, hàng không,Vietravel Airlines,Bamboo Airways,Giá vé', '<p><span style=\"font-size:16px\"><strong>Hai ng&agrave;y cuối c&ugrave;ng của dịp nghỉ Tết Nguy&ecirc;n đ&aacute;n Nh&acirc;m Dần, người d&acirc;n đổ x&ocirc; về th&agrave;nh phố đẩy&nbsp;<a href=\"https://thanhnien.vn/gia-ve-may-bay/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"giá vé máy bay\">gi&aacute; v&eacute; m&aacute;y bay</a>&nbsp;cao ch&oacute;t v&oacute;t.</strong></span></p>\r\n', 56, 1, '2022-02-08 05:12:12', '2022-02-08 05:12:12'),
(20, 'Uzumaki Naruto', 'Giá vàng hôm nay 8.2.2022: SJC xuất hiện giá kỷ lục trên 64 triệu đồng/lượng', 'gia-vang-hom-nay-822022-sjc-xuat-hien-gia-ky-luc-tren-64-trieu-dongluong', '762101e76e.jpeg', '<p><span style=\"font-size:16px\">64,4 triệu đồng/lượng l&agrave; mức gi&aacute; b&aacute;n ra&nbsp;<a href=\"https://thanhnien.vn/co-nen-mua-vang-ngay-than-tai-khi-gia-len-muc-ky-luc-post1427483.html\" title=\"Có nên mua vàng ngày Thần Tài khi giá lên mức kỷ lục\">v&agrave;ng miếng SJC&nbsp;</a>m&agrave; Ng&acirc;n h&agrave;ng TMCP S&agrave;i G&ograve;n (SCB) c&ocirc;ng bố s&aacute;ng 8.2, c&ograve;n chiều mua v&agrave;o ở mức 63,2 triệu đồng/lượng. Ch&ecirc;nh lệch giữa gi&aacute; mua v&agrave; b&aacute;n v&agrave;ng miếng của nh&agrave; băng n&agrave;y l&ecirc;n đến 1,2 triệu đồng/lượng.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Trong khi đ&oacute;, c&aacute;c đơn vị&nbsp;<a href=\"https://thanhnien.vn/tai-chinh-kinh-doanh/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"kinh doanh\">kinh doanh</a>&nbsp;v&agrave;ng kh&aacute;c c&ocirc;ng bố gi&aacute; b&aacute;n ra v&agrave;ng miếng SJC ở mức thấp hơn đến 1,15 triệu đồng/lượng, cụ thể Eximbank b&aacute;n v&agrave;ng với gi&aacute; 63,25 triệu đồng/lượng (giảm 50.000 đồng/lượng so với gi&aacute; chiều ng&agrave;y 7.2), c&ograve;n mua v&agrave;o với gi&aacute; 62,75 triệu đồng/lượng. Ri&ecirc;ng C&ocirc;ng ty v&agrave;ng bạc đ&aacute; qu&yacute; S&agrave;i G&ograve;n - SJC giữ gi&aacute; v&agrave;ng miếng SJC kh&ocirc;ng đổi, mua v&agrave;o 62,8 triệu đồng/lượng v&agrave; b&aacute;n ra 63,45 triệu đồng/lượng. Gi&aacute; v&agrave;ng miếng SJC đang cao hơn thế giới từ 13,45 - 14,4 triệu đồng/lượng.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Vàng SJC xuất hiện mức giá trên 64 triệu đồng/lượng\" src=\"ckeditor/09c08649-45cd-45b6-9949-e8eac4771553-5326.jpeg\" style=\"height:1367px; width:2048px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>V&agrave;ng SJC xuất hiện mức gi&aacute; tr&ecirc;n 64 triệu đồng/lượng</p>\r\n\r\n			<div class=\"source\">\r\n			<p>NGỌC THẮNG</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Thế nhưng do nhu cầu mua v&agrave;ng nhỏ lẻ ng&agrave;y v&iacute;a Thần T&agrave;i gia tăng n&ecirc;n C&ocirc;ng ty SJC tăng gi&aacute; v&agrave;ng nữ trang, v&agrave;ng nhẫn th&ecirc;m 100.000 đồng/lượng. Gi&aacute; v&agrave;ng nhẫn 4 số 9 mua v&agrave;o l&ecirc;n 54 triệu đồng/lượng, c&ograve;n chiều b&aacute;n ra l&ecirc;n 54,9 triệu đồng/lượng. V&agrave;ng nữ trang 4 số 9 c&oacute; gi&aacute; 53,8 triệu đồng/lượng ở chiều mua v&agrave;o v&agrave; b&aacute;n ra 54,5 triệu đồng/lượng.</span></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Kim loại qu&yacute; tr&ecirc;n thị trường quốc tế tăng 10 USD/ounce, l&ecirc;n 1.821 USD/ounce. Sự lo ngại về&nbsp;<a href=\"https://thanhnien.vn/gia-dau/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"giá dầu\">gi&aacute; dầu</a>&nbsp;gia tăng k&eacute;o theo lạm ph&aacute;t l&ecirc;n cao nữa trong thời gian tới đ&atilde; hỗ trợ cho v&agrave;ng tăng gi&aacute;. Khả năng Cục Dự trữ Li&ecirc;n bang Mỹ (Fed) sẽ tăng l&atilde;i suất ngoại tệ để k&igrave;m h&atilde;m lạm ph&aacute;t.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Hiện tại, chỉ số CPI đang ở mức 7% dựa tr&ecirc;n b&aacute;o c&aacute;o th&aacute;ng trước, mức cao kỷ lục trong 40 năm. Theo c&aacute;c nh&agrave; ph&acirc;n t&iacute;ch được thăm d&ograve; bởi Bloomberg, dự kiến CPI ​​sẽ tăng l&ecirc;n mức 7,3% so với năm ngo&aacute;i. Nếu c&aacute;c dự b&aacute;o l&agrave; ch&iacute;nh x&aacute;c v&agrave; &aacute;p lực lạm ph&aacute;t so với CPI ở mức 7,3%, điều đ&oacute; sẽ chỉ củng cố quyết t&acirc;m của Fed về việc&nbsp;<a href=\"https://thanhnien.vn/ngan-hang-chay-dua-huy-dong-von-post1423204.html\" title=\"Ngân hàng chạy đua huy động vốn\">tăng l&atilde;i suất</a>&nbsp;trong th&aacute;ng 3. Dự b&aacute;o đ&oacute; rất gần với c&ocirc;ng cụ theo d&otilde;i Fed của CME dự đo&aacute;n c&oacute; 25% khả năng Fed sẽ tăng l&atilde;i suất th&ecirc;m 0,5% v&agrave;o th&aacute;ng 3. Th&ecirc;m v&agrave;o đ&oacute;, căng thẳng ch&iacute;nh trị giữa Nga v&agrave; Ukraine vẫn tiếp diễn. Trong trường hợp Nga x&acirc;m lược Ukraine, điều n&agrave;y sẽ hỗ trợ cho v&agrave;ng tăng gi&aacute;.</span></p>\r\n', 0, 'giá vàng SJC, Eximbank,Vàng miếng SJC,SCB,CME,Nữ trang,Công ty SJC,Mua vào,SJC', '<p><span style=\"font-size:16px\"><strong><a href=\"https://thanhnien.vn/gia-vang/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Giá vàng\">Gi&aacute; v&agrave;ng</a>&nbsp;miếng SJC tr&ecirc;n thị trường kh&ocirc;ng ngừng gia tăng tốc độ tăng v&agrave; li&ecirc;n tục ph&aacute; c&aacute;c mức kỷ lục. Mức gi&aacute; 64,4 triệu đồng mỗi lượng v&agrave;ng miếng SJC đ&atilde; xuất hiện v&agrave;o s&aacute;ng 8.2.</strong></span></p>\r\n', 57, 1, '2022-02-08 05:26:24', '2022-02-08 05:26:24'),
(21, 'Uzumaki Naruto', 'Giá USD hôm nay 8.2.2022: Đô la tự do tiếp tục tăng', 'gia-usd-hom-nay-822022-do-la-tu-do-tiep-tuc-tang', 'eac39b76d8.jpg', '<p><span style=\"font-size:16px\">S&aacute;ng 8.2, tỷ gi&aacute; trung t&acirc;m do&nbsp;<a href=\"https://thanhnien.vn/tai-chinh-kinh-doanh/ngan-hang/\" target=\"_blank\">Ng&acirc;n h&agrave;ng</a>&nbsp;Nh&agrave; nước c&ocirc;ng bố l&agrave; 23.090 đồng/USD, tăng 9 đồng so với h&ocirc;m qua. Ng&acirc;n h&agrave;ng Vietcombank cũng tăng 20 đồng, đưa gi&aacute; mua USD l&ecirc;n 22.500 đồng/USD v&agrave; b&aacute;n ra 22.810 đồng/USD. Tương tự, ng&acirc;n h&agrave;ng Eximbank cũng cộng 60 đồng ở chiều mua v&agrave;o, l&ecirc;n gi&aacute; 22.550 đồng/USD nhưng giảm 10 đồng ở chiều b&aacute;n ra, xuống 22.750 đồng/USD...&nbsp;<a href=\"https://thanhnien.vn/gia-usd-hom-nay-4-2-2022-dong-bac-xanh-tu-do-tang-nhe-post1426780.html\" title=\"Giá USD hôm nay 4.2.2022: Đồng bạc xanh tự do tăng nhẹ\">Gi&aacute; USD</a>&nbsp;tự do tiếp tục tăng th&ecirc;m 10 đồng so với h&ocirc;m qua, l&ecirc;n mức mua v&agrave;o 23.560 đồng/USD v&agrave; b&aacute;n ra l&agrave; 23.660 đồng/USD.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Mưa lớn bất thường từng gây ngập lụt khu phố cổ Hà Nội\" src=\"ckeditor/anh-1-1401.jpg\" style=\"height:auto; width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Mưa lớn bất thường từng g&acirc;y ngập lụt khu phố cổ H&agrave; Nội</p>\r\n\r\n			<div class=\"source\">\r\n			<p>L&ecirc; qu&acirc;n</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Tr&ecirc;n thị trường&nbsp;<a href=\"https://thanhnien.vn/thang-o-world-cup-tai-sao-khong-post1427592.html\" title=\"Thắng ở World Cup, tại sao không?\">thế giới</a>, chỉ số USD-Index tiếp tục giảm nhẹ 0,04 điểm xuống c&ograve;n 95,42 điểm. Tương tự, lợi suất tr&aacute;i phiếu ch&iacute;nh phủ Mỹ kỳ hạn hai năm cũng giảm 2,4 điểm cơ bản xuống c&ograve;n 1,298%. Theo Reuters,&nbsp;<a href=\"https://thanhnien.vn/gia-usd-hom-nay-3-2-2022-do-la-tu-do-giam-post1426632.html\" title=\"Giá USD hôm nay 3.2.2022: Đô la tự do giảm \">gi&aacute; USD</a>&nbsp;suy yếu sau khi Ng&acirc;n h&agrave;ng Trung ương ch&acirc;u &Acirc;u (ECB) c&oacute; quan điểm tr&aacute;i ngược với kỳ vọng thị trường khi đề cập đến vấn đề đẩy nhanh việc tăng l&atilde;i suất, đẩy lợi suất tr&aacute;i phiếu khu vực ch&acirc;u &Acirc;u tăng l&ecirc;n mức cao nhất trong nhiều năm. Cụ thể, tuy&ecirc;n bố của Chủ tịch ECB Christine Lagarde mới đ&acirc;y về khả năng n&acirc;ng l&atilde;i suất v&agrave;o cuối năm nay l&agrave; một yếu tố then chốt g&acirc;y ra sự biến động tr&ecirc;n thị trường tiền tệ. Theo c&aacute;c nh&agrave; ph&acirc;n t&iacute;ch, với định hướng mới từ ECB, đồng euro sẽ thu h&uacute;t nhiều sự ch&uacute; &yacute; từ giới đầu tư. Hiện tại, c&aacute;c nh&agrave; giao dịch đang chờ đợi Thống đốc Ng&acirc;n h&agrave;ng Anh (BoE) Bailey đưa ra định hướng của cơ quan n&agrave;y trong một b&agrave;i ph&aacute;t biểu v&agrave;o giữa tuần v&igrave; điều đ&oacute; c&oacute; thể t&aacute;c động đến đồng bảng Anh.</span></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">B&ecirc;n cạnh đ&oacute;, sự tăng vọt bất ngờ trong lĩnh vực việc l&agrave;m của Mỹ v&agrave;o th&aacute;ng 1 đ&atilde; l&agrave;m gia tăng triển vọng về kế hoạch n&acirc;ng l&atilde;i suất mạnh mẽ của Cục Dự trữ Li&ecirc;n bang Mỹ (Fed). Ch&iacute;nh v&igrave; vậy, sự cạnh tranh giữa đồng bạc xanh v&agrave; đồng euro ng&agrave;y c&agrave;ng r&otilde; rệt khiến c&aacute;c nh&agrave; đầu tư trở n&ecirc;n thận trọng. Đồng thời,&nbsp;<a href=\"https://thanhnien.vn/gia-usd-hom-nay-2-2-2022-sut-giam-khi-nha-dau-tu-chot-loi-post1426482.html\" title=\"Giá USD hôm nay 2.2.2022: Sụt giảm khi nhà đầu tư chốt lời\">gi&aacute; USD</a>&nbsp;giảm trong c&aacute;c phi&ecirc;n gần đ&acirc;y c&ograve;n do&nbsp;<a href=\"https://thanhnien.vn/gia-dau/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"giá dầu\">gi&aacute; dầu</a>&nbsp;leo thang mạnh khi m&agrave; m&acirc;u thuẫn Nga - phương T&acirc;y về Ukraine gia tăng. Gi&aacute; dầu leo thang sẽ khiến lạm ph&aacute;t tăng mạnh...</span></p>\r\n', 0, 'giá USD hôm nay ,Ngân hàng trung ương châu âu,Lợi suất,Ngân hàng EximBank,EURO,Ngân hàng Anh,Lên giá,Trái phiếu,giá USD ngày 8.2', '<p><strong><span style=\"font-size:16px\">Gi&aacute; USD s&aacute;ng 8.2 trong nước đồng loạt đi l&ecirc;n d&ugrave;&nbsp;<a href=\"https://thanhnien.vn/the-gioi/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"thế giới\">thế giới</a>&nbsp;tiếp tục đ&agrave; giảm.&nbsp;</span></strong></p>\r\n', 57, 1, '2022-02-08 05:33:38', '2022-02-08 05:33:38'),
(22, 'Uzumaki Naruto', 'Cổ phiếu thép, thủy sản \'tím lịm\', VN-Index chinh phục lại mức 1.500 điểm', 'co-phieu-thep-thuy-san-tim-lim-vn-index-chinh-phuc-lai-muc-1500-diem', '99230d519e.jpg', '<p><span style=\"font-size:16px\">Thị trường chứng kho&aacute;n ng&agrave;y 8.2 giằng co li&ecirc;n tục nhưng vẫn chốt phi&ecirc;n trong sắc xanh. Cuối phi&ecirc;n, VN-Index tăng 3,33 điểm l&ecirc;n 1.500,99 điểm. Nhưng ngược lại, chỉ số HNX-Index kh&ocirc;ng giữ được sắc xanh m&agrave; quay đầu giảm 1,44 điểm xuống 417,89 điểm.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Nhiều cổ phiếu tăng cao phiên 8.2\" src=\"ckeditor/anh3ck-daongocthach_qjma.jpg\" style=\"width:736px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Nhiều cổ phiếu tăng cao phi&ecirc;n 8.2</p>\r\n\r\n			<div class=\"source\">\r\n			<p>Đ&Agrave;O NGỌC THẠCH</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">D&ugrave; thị trường rung lắc kh&aacute; mạnh khiến VN-Index kh&ocirc;ng thể l&ecirc;n cao nhưng nhiều cổ phiếu vẫn tăng hết bi&ecirc;n độ cho ph&eacute;p. C&aacute;c m&atilde; th&eacute;p, thủy sản như VHC, HSG, NKG, TLH, SMC, POM, IDI, CMX, ANV... đặc biệt, nh&oacute;m cổ phiếu ng&agrave;nh th&eacute;p đ&atilde; rất l&acirc;u rồi mới c&oacute; phi&ecirc;n giao dịch đầy hứng khởi sau nhiều th&aacute;ng sụt giảm li&ecirc;n tục. Đơn cử cổ phiếu HPG tăng tới gần 6% v&agrave; ri&ecirc;ng m&atilde; n&agrave;y đ&atilde; gi&uacute;p k&eacute;o VN-Index l&ecirc;n gần 3 điểm. B&ecirc;n cạnh đ&oacute;, sắc xanh chiếm lĩnh nh&oacute;m ng&agrave;nh vận tải, đặc biệt l&agrave; với c&aacute;c m&atilde; vận tải đường thủy như VSC, DXP, PJT đều tăng tốt. Trong khi đ&oacute;, nh&oacute;m cổ phiếu bất động sản, x&acirc;y dựng cũng c&oacute; một số m&atilde; tăng tốt nhưng số lượng m&atilde; giảm vẫn chiếm kh&aacute; nhiều, thậm ch&iacute; nằm s&agrave;n như CII, CEO, DIG, DRH, HDC, NBB...</span></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<div class=\"note_box\">\r\n<p><span style=\"font-size:16px\">Thanh khoản thị trường tăng mạnh so với h&ocirc;m qua với tổng gi&aacute; trị khớp lệnh đạt 23.634 tỉ đồng, tăng 20,7%. Phi&ecirc;n n&agrave;y khối ngoại đ&atilde; b&aacute;n r&ograve;ng 348 tỉ đồng ở s&agrave;n HOSE. S&aacute;ng 8.2 (tức m&ugrave;ng 8 th&aacute;ng gi&ecirc;ng năm Nh&acirc;m Dần), Sở Giao dịch chứng kho&aacute;n TP.HCM (HOSE) tổ chức Lễ đ&aacute;nh cồng đầu Xu&acirc;n Nh&acirc;m Dần 2022. Ph&aacute;t biểu tại buổi lễ, &ocirc;ng Phan Văn M&atilde;i - Chủ tịch UBND TP.HCM - đ&atilde; biểu dương những kết quả đạt được trong năm 2021 v&agrave; khẳng định vị tr&iacute; hạt nh&acirc;n của HOSE. Chủ tịch UBND TP.HCM mong muốn Sở Giao dịch chứng kho&aacute;n TP.HCM tiếp tục nỗ lực phấn đấu để trở th&agrave;nh một trong những Sở Giao dịch chứng kho&aacute;n mang đẳng cấp quốc tế, đ&oacute;ng g&oacute;p nhiều hơn nữa v&agrave;o việc phục hồi kinh tế của th&agrave;nh phố. Trong thời gian tới, th&agrave;nh phố sẽ tập trung ho&agrave;n th&agrave;nh Đề &aacute;n x&acirc;y dựng TP.HCM trở th&agrave;nh Trung t&acirc;m t&agrave;i ch&iacute;nh khu vực v&agrave; quốc tế để th&uacute;c đẩy thị trường chứng kho&aacute;n th&agrave;nh phố ph&aacute;t triển.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">&Ocirc;ng Nguyễn Đức Chi - Thứ trưởng Bộ T&agrave;i ch&iacute;nh cũng nhấn mạnh c&aacute;c nhiệm vụ quan trong của ng&agrave;nh chứng kho&aacute;n trong năm 2022. Đ&oacute; l&agrave; đảm bảo đưa v&agrave;o vận h&agrave;nh hệ thống c&ocirc;ng nghệ th&ocirc;ng tin KRX theo đ&uacute;ng tiến độ dự &aacute;n, đảm bảo vận h&agrave;nh thị trường li&ecirc;n tục hiệu quả, an to&agrave;n về hệ thống v&agrave; xuy&ecirc;n suốt về th&ocirc;ng tin; Bước đầu phối hợp triển khai cơ cấu lại thị trường chứng kho&aacute;n theo Th&ocirc;ng tư 57/2021/TT-BTC, chủ động thực hiện c&ocirc;ng t&aacute;c ph&acirc;n bảng c&aacute;c c&ocirc;ng ty ni&ecirc;m yết; Tập trung ổn định thị trường, tăng cường c&ocirc;ng t&aacute;c gi&aacute;m s&aacute;t, n&acirc;ng cao chất lượng c&ocirc;ng ty ni&ecirc;m yết về quản trị v&agrave; c&ocirc;ng bố th&ocirc;ng tin, đảm bảo thị trường an to&agrave;n minh bạch...</span></p>\r\n</div>\r\n', 0, 'VN-Index,PJT,DXP,CMX,ANV,TLH,IDI,SMC,POM,VHC,chứng khoán', '<p><span style=\"font-size:16px\"><strong>Ng&agrave;y 8.2, nhiều cổ phiếu tiếp tục tăng gi&aacute; đưa VN-Index quay trở lại mức 1.500 điểm.&nbsp;</strong></span></p>\r\n', 58, 1, '2022-02-08 05:47:21', '2022-02-08 05:47:21'),
(23, 'Uzumaki Naruto', 'Cổ phiếu đầu năm Nhâm Dần \'bay\' cao', 'co-phieu-dau-nam-nham-dan-bay-cao', '2538cc33e3.jpg', '<p><span style=\"font-size:16px\">S&aacute;ng nay (7.2), thị trường&nbsp;<a href=\"https://thanhnien.vn/tai-chinh-kinh-doanh/chung-khoan/\" target=\"_blank\">chứng kho&aacute;n</a>&nbsp;mở cửa giao dịch trở lại phi&ecirc;n đầu năm mới Nh&acirc;m Dần 2022. H&agrave;ng loạt cổ phiếu tăng mạnh ngay từ đầu phi&ecirc;n. Đến l&uacute;c sau 10 giờ, VN-Index tăng 20,48 điểm l&ecirc;n 1.499,44 điểm; HNX-Index tăng 4,52 điểm l&ecirc;n 421,25 điểm v&agrave; UPCoM-Index tăng 0,88 điểm l&ecirc;n 110,57 điểm.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Hàng loạt cổ phiếu tăng cao sáng 7.2\" src=\"ckeditor/ckmoitiepngocthang_xegy.jpg\" style=\"height:424px; width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>H&agrave;ng loạt cổ phiếu tăng cao s&aacute;ng 7.2</p>\r\n\r\n			<div class=\"source\">\r\n			<p>NGỌC THẮNG</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Phi&ecirc;n n&agrave;y, nh&oacute;m cổ phiếu h&agrave;ng kh&ocirc;ng v&agrave; c&aacute;c c&ocirc;ng ty li&ecirc;n quan bật tăng mạnh. Thậm ch&iacute;, HVN được k&eacute;o l&ecirc;n mức gi&aacute; trần 26.000 đồng/cổ phiếu. B&ecirc;n cạnh đ&oacute;, c&aacute;c m&atilde; h&agrave;ng kh&ocirc;ng như VJC tăng 5,3%, ACV tăng 3,3%, AST tăng 5,9%... Đồng thời, nh&oacute;m cổ phiếu dầu kh&iacute; giao dịch rất t&iacute;ch cực, PXS tăng 5,9%, PVS tăng 5,5%, OIL tăng 5,2%, BSR tăng 4,4%, GAS tăng 3,6%... Hay c&aacute;c m&atilde; t&agrave;i ch&iacute;nh như ng&acirc;n h&agrave;ng, chứng kho&aacute;n cũng bay cao với số lượng cổ phiếu tăng gi&aacute; chiếm &aacute;p đảo, chỉ c&oacute; v&agrave;i m&atilde; hiếm hoi giao dịch ở tham chiếu như TPB, BID, CTG. C&ograve;n với c&aacute;c cổ phiếu bất động sản, mức biến động mạnh hơn khi xuất hiện một số m&atilde; nhanh ch&oacute;ng tăng trần hết bi&ecirc;n độ nhưng một số m&atilde; vẫn ch&igrave;m trong sắc đỏ... Nhưng nh&igrave;n chung, đa số cổ phiếu đều đi l&ecirc;n trong phi&ecirc;n mở h&agrave;ng đầu năm mới sau kỳ nghỉ tết.</span></p>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Trước đ&oacute;, thị trường chứng kho&aacute;n tăng điểm nhẹ trong tuần giao dịch cuối c&ugrave;ng của năm T&acirc;n Sửu. Giao dịch của khối ngoại l&agrave; điểm cộng của thị trường chứng kho&aacute;n khi mua r&ograve;ng 1.951 tỉ đồng. H&agrave;ng loạt c&ocirc;ng ty đ&atilde; c&ocirc;ng bố B&aacute;o c&aacute;o t&agrave;i ch&iacute;nh qu&yacute; 4/2021 v&agrave; cả năm vừa qua với xu hướng tăng trưởng mạnh mẽ bất chấp một năm dịch bệnh đầy biến động. Cộng th&ecirc;m với ch&iacute;nh s&aacute;ch phục hồi v&agrave; ph&aacute;t triển kinh tế của Ch&iacute;nh phủ đ&atilde; được ban h&agrave;nh, nhiều c&ocirc;ng ty chứng kho&aacute;n đ&atilde; nhận định thị trường hiện c&oacute; nhiều th&ocirc;ng tin t&iacute;ch cực để tiếp tục duy tr&igrave; đ&agrave; tăng v&agrave; c&oacute; thể sẽ chinh phục lại đỉnh cao tr&ecirc;n 1.520 điểm.</span></p>\r\n', 0, 'chứng khoán,PXS,AST,OIL,HVN,VJC,BSR,TPB,ACV,HNX-INDEX,Nhâm Dần', '<p><span style=\"font-size:16px\"><strong>S&aacute;ng 7.2, h&agrave;ng loạt cổ phiếu tăng mạnh trong phi&ecirc;n giao dịch đầu năm mới Nh&acirc;m Dần 2022.</strong></span></p>\r\n', 58, 1, '2022-02-08 05:57:14', '2022-02-08 05:57:14');
INSERT INTO `tbl_product` (`Product_ID`, `Product_UserName`, `Product_Name`, `Product_Slug`, `Product_Image`, `Product_Content`, `Product_View`, `Meta_Keywords_Product`, `Meta_Desc_Product`, `Cate_Pro_ID`, `Product_Status`, `created_at`, `updated_at`) VALUES
(24, 'Uzumaki Naruto', 'Cây mai vàng khoảng 200 năm được chủ nhân mua gần 2 tỉ gây sốt miền Tây', 'cay-mai-vang-khoang-200-nam-duoc-chu-nhan-mua-gan-2-ti-gay-sot-mien-tay', 'bef44068bc.png', '<p><span style=\"font-size:16px\">C&acirc;y&nbsp;<a href=\"https://thanhnien.vn/doc-nhat-mien-tay-bo-suu-tap-mai-vang-doc-la-co-cay-dat-vang-sjc-post1410702.html\" title=\"Độc nhất miền Tây: Bộ sưu tập mai vàng \'độc lạ\', có cây dát vàng SJC\">mai v&agrave;ng</a>&nbsp;cổ thụ khoảng 200 năm tuổi n&agrave;y c&oacute; chiều cao 5 m, bề ho&agrave;nh gốc 1,4 m, t&aacute;n rộng 3,5 m x&ograve;e đều, nằm trong bộ sưu tập hơn 10 c&acirc;y mai &ldquo;khủng&rdquo; của &ocirc;ng Vương Tấn Dũng (57 tuổi, ngụ TP.Long Xuy&ecirc;n, An Giang).</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Cây mai 200 năm tuổi của ông Dũng\" src=\"ckeditor/anh-3-505.png\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>C&acirc;y mai 200 năm tuổi của &ocirc;ng Dũng</p>\r\n\r\n			<div class=\"source\">\r\n			<p>DUY T&Acirc;N</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">C&acirc;y mai hiện được trưng b&agrave;y tại một qu&aacute;n c&agrave; ph&ecirc; tr&ecirc;n đường Nguyễn Ho&agrave;ng, P.Mỹ H&ograve;a, TP.Long Xuy&ecirc;n, An Giang. Những ng&agrave;y&nbsp;<a href=\"https://thanhnien.vn/sat-tet-nguyen-dan-nguoi-phu-nu-nhat-duoc-150-trieu-dong-tim-nguoi-tra-lai-post1426144.html\" title=\"Sát Tết Nguyên đán, người phụ nữ nhặt được 150 triệu đồng tìm người trả lại\">Tết Nguy&ecirc;n đ&aacute;n&nbsp;</a>Nh&acirc;m Dần 2022, c&acirc;y nở hoa rực rỡ, nhuộm v&agrave;ng cả một khoảng s&acirc;n. B&ecirc;n cạnh đ&oacute;, những c&acirc;y mai &quot;khủng&quot; trong bộ sưu tập cũng bung hoa dưới nắng xu&acirc;n, thu h&uacute;t rất đ&ocirc;ng kh&aacute;ch đến chi&ecirc;m ngưỡng,&nbsp;<a href=\"https://thanhnien.vn/nguoi-sai-gon-di-choi-duong-hoa-nguyen-hue-2022-khong-duoc-coi-khau-trang-khi-chup-anh-post1423351.html\" title=\"Người Sài Gòn đi chơi đường hoa Nguyễn Huệ 2022 không được cởi khẩu trang khi chụp ảnh\">chụp ảnh</a>.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Bộ sưu tập hơn 10 cây mai “khủng” của ông Dũng\" src=\"ckeditor/anh-1-4714.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Bộ sưu tập hơn 10 c&acirc;y mai &ldquo;khủng&rdquo; của &ocirc;ng Dũng</p>\r\n\r\n			<div class=\"source\">\r\n			<p>DUY T&Acirc;N</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Hoa bung nở khoe sắc ngày tết\" src=\"ckeditor/anh-2-2848.png\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Hoa bung nở khoe sắc ng&agrave;y tết</p>\r\n\r\n			<div class=\"source\">\r\n			<p>DUY T&Acirc;N</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Cây mai gần 200 năm tuổi có bề hoành gốc 1,4 m\" src=\"ckeditor/anh-4-1625.png\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>C&acirc;y mai gần 200 năm tuổi c&oacute; bề ho&agrave;nh gốc 1,4 m</p>\r\n\r\n			<div class=\"source\">\r\n			<p>DUY T&Acirc;N</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Được biết, c&acirc;y mai n&agrave;y &ocirc;ng Dũng t&igrave;m mua ở c&ugrave; lao T&acirc;n Lộc (Q.Thốt Nốt, TP.Cần Thơ) từ cuối năm 2018 với gi&aacute; gần 1,7 tỉ đồng. Ri&ecirc;ng c&aacute;c c&acirc;y c&ograve;n lại trong bộ sưu tập cũng c&oacute; độ tuổi h&agrave;ng chục năm. Trong đ&oacute;, c&oacute; 3 c&acirc;y mai với d&aacute;ng thế &quot;mẫu tử&quot;, độ tuổi 80 năm.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Tán cây rộng 3,5 m xòe đều\" src=\"ckeditor/anh-5-8007.png\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>T&aacute;n c&acirc;y rộng 3,5 m x&ograve;e đều</p>\r\n\r\n			<div class=\"source\">\r\n			<p>DUY T&Acirc;N</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Hiện bộ sưu tập mai v&agrave;ng của &ocirc;ng Dũng đang độ nở b&ocirc;ng rực rỡ, khiến hầu hết kh&aacute;ch đến chi&ecirc;m ngưỡng đều xu&yacute;t xoa.</span></p>\r\n', 0, 'Mai vàng 200 năm, An Giang ,Mai vàng,Cây mai,TP.Long Xuyê', '<p><span style=\"font-size:16px\"><strong>&Ocirc;ng Vương Tấn Dũng ở An Giang hiện sở hữu c&acirc;y mai v&agrave;ng khoảng 200 năm, được &ocirc;ng mua từ năm 2018 gi&aacute; 1,7 tỉ đồng.</strong></span></p>\r\n', 65, 1, '2022-02-08 11:29:24', '2022-02-08 11:29:24'),
(31, 'Uzumaki Naruto', '\'Người hùng\' Nguyễn Ngọc Mạnh: Mong làm người thường, giúp người ở tâm thế vô tư', 'nguoi-hung-nguyen-ngoc-manh-mong-lam-nguoi-thuong-giup-nguoi-o-tam-the-vo-tu', '3bacfc8838.jpg', '<p><span style=\"font-size:16px\">Nhiều người vẫn chưa qu&ecirc;n sự việc b&eacute; Nguyễn Phương Huyền (4 tuổi, tr&uacute; chung cư 60B Nguyễn Huy Tưởng, Q.Thanh Xu&acirc;n, H&agrave; Nội)&nbsp;<a href=\"https://thanhnien.vn/bo-be-gai-3-tuoi-roi-tu-tang-12a-con-toi-nhu-duoc-sinh-ra-lan-thu-hai-post1041960.html\" target=\"_blank\">đu b&aacute;m v&agrave; rơi từ tầng 12 chung cư xuống</a>, may mắn được anh Nguyễn Ngọc Mạnh (32 tuổi, tr&uacute; H.Đ&ocirc;ng Anh, H&agrave; Nội) đ&oacute;n đỡ, cứu b&eacute; tho&aacute;t chết trong gang tấc v&agrave;o chiều 28.2.2021.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Anh Mạnh sau đ&oacute; được tặng nhiều bằng khen, nhiều người coi anh l&agrave; &ldquo;người h&ugrave;ng&rdquo; của năm 2021.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Bé Huyền đu bám bên ngoài trước khi rơi xuống dưới\" src=\"ckeditor/3-vvoo-6675.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>B&eacute; Huyền đu b&aacute;m b&ecirc;n ngo&agrave;i trước khi rơi xuống dưới</p>\r\n\r\n			<div class=\"source\">\r\n			<p>CHỤP M&Agrave;N H&Igrave;NH</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Gần 1 năm xảy ra sự việc, anh Nguyễn Văn Hiệp (bố ruột b&eacute; Huyền) vẫn chưa hết b&agrave;ng ho&agrave;ng khi nghĩ lại khoảnh khắc con m&igrave;nh rơi từ tầng 12 chung cư xuống m&aacute;i t&ocirc;n. V&agrave; kh&ocirc;ng biết bao nhi&ecirc;u lần anh Hiệp nhắc lại 2 từ &ldquo;biết ơn&rdquo; khi n&oacute;i về anh Mạnh.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">&ldquo;B&eacute; Huyền đ&atilde; sống v&agrave; rất khỏe mạnh. Nếu kh&ocirc;ng c&oacute; Mạnh, năm nay c&oacute; thể gia đ&igrave;nh t&ocirc;i kh&ocirc;ng c&oacute; tết. Mỗi khoảnh khắc được b&igrave;nh y&ecirc;n b&ecirc;n c&aacute;c con, t&ocirc;i đều biết ơn Mạnh&rdquo;, anh Hiệp n&oacute;i.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Theo anh Hiệp, sau sự việc, hai b&ecirc;n gia đ&igrave;nh thường xuy&ecirc;n li&ecirc;n lạc với nhau, nhưng do ảnh hưởng của dịch bệnh n&ecirc;n đ&atilde; l&acirc;u rồi anh Mạnh chưa được gặp lại Huyền. Dự kiến dịp tết n&agrave;y, anh Hiệp sẽ cho con về thăm bố nu&ocirc;i (anh Mạnh) v&agrave; c&aacute;c em, c&ugrave;ng đi&nbsp;<a href=\"https://thanhnien.vn/du-lich/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"du lịch\">du lịch</a>.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Vừa lấy trong cabin &ocirc; t&ocirc; chiếc v&aacute;y mới tinh, anh&nbsp;<a href=\"https://thanhnien.vn/cu-dan-hoang-so-sau-vu-viec-be-gai-roi-tu-tang-13-chung-cu-post1253329.html\" target=\"_blank\">Nguyễn Ngọc Mạnh</a>&nbsp;vừa khoe, tết năm nay (2022), gia đ&igrave;nh anh c&oacute; th&ecirc;m th&agrave;nh vi&ecirc;n mới, những mối quan hệ mới v&agrave; lần đầu ti&ecirc;n anh Mạnh được tự tay chọn m&oacute;n qu&agrave; tết tặng con g&aacute;i nu&ocirc;i của m&igrave;nh.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Sau sự việc, anh Mạnh được mọi người ví như người hùng, được nhiều cấp tặng bằng khen\" src=\"ckeditor/dsc-3384-8029.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Sau sự việc, anh Mạnh được mọi người v&iacute; như người h&ugrave;ng, được nhiều cấp tặng bằng khen</p>\r\n\r\n			<div class=\"source\">\r\n			<p>TRẦN CƯỜNG</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">&ldquo;Huyền bằng tuổi con g&aacute;i lớn của t&ocirc;i, hễ gặp nhau l&agrave; 2 đứa lại quấn lấy nhau như th&acirc;n từ bao giờ. Từ khi nhận Huyền l&agrave;m con nu&ocirc;i, t&ocirc;i l&agrave;m g&igrave; cũng nghĩ đến 3 đứa con g&aacute;i (anh Mạnh c&oacute; 2 con g&aacute;i ruột - ph&oacute;ng vi&ecirc;n) n&ecirc;n v&agrave;o tiệm quần &aacute;o trẻ em l&agrave; t&ocirc;i mua cho c&aacute;c ch&aacute;u v&aacute;y &aacute;o giống hệt nhau&rdquo;, anh Mạnh kể v&agrave; cho biết, hai gia đ&igrave;nh đ&atilde; đặt v&eacute; đi&nbsp;<a href=\"https://thanhnien.vn/tim-kiem/?q=du%20l%E1%BB%8Bch\" target=\"_blank\">du lịch</a>&nbsp;ở Mai Ch&acirc;u (H&ograve;a B&igrave;nh) v&agrave;o những ng&agrave;y cuối nghỉ tết để c&oacute; dịp ngồi với nhau ng&agrave;y đầu năm mới, cũng như để bọn trẻ được chơi với nhau, trải nghiệm nhiều hơn.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Nh&igrave;n những tấm bằng khen đủ k&iacute;ch thước, anh Mạnh cho rằng đ&atilde; rất n&acirc;ng niu, thường xuy&ecirc;n lau ch&ugrave;i v&agrave; coi đ&oacute; như một động lực để ho&agrave;n thiện bản th&acirc;n mỗi ng&agrave;y. Tuy nhi&ecirc;n, anh Mạnh mong được l&agrave;m một người b&igrave;nh thường, sống đơn giản, đ&oacute;n một c&aacute;i tết b&igrave;nh y&ecirc;n b&ecirc;n gia đ&igrave;nh.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Anh Mạnh mong được sống như một người bình thường\" src=\"ckeditor/dsc-3430-4520.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Anh Mạnh mong được sống như một người b&igrave;nh thường</p>\r\n\r\n			<div class=\"source\">\r\n			<p>TRẦN CƯỜNG</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">&ldquo;Đ&acirc;y l&agrave; những gi&aacute; trị tinh thần kh&ocirc;ng phải ai cũng may mắn c&oacute; được trong đời, t&ocirc;i treo n&oacute; (những tấm bằng khen - ph&oacute;ng vi&ecirc;n) ở ph&ograve;ng kh&aacute;ch, trước b&agrave;n thờ tổ ti&ecirc;n để mọi người c&ugrave;ng thấy, v&agrave; t&ocirc;i cũng thấy để ho&agrave;n thiện hơn nữa&rdquo;, anh Mạnh cho hay.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Tuy nhi&ecirc;n, anh Mạnh cũng chỉ mong được sống b&igrave;nh thường, &quot;kh&ocirc;ng ai nhớ mặt v&agrave; biết t&ecirc;n&quot; để lại tiếp tục gi&uacute;p đỡ mọi người.</span></p>\r\n', 0, 'Nguyễn Ngọc Mạnh, người hùng,Nguyễn Phương Huyền,Nguyễn Huy Tưởng,Bằng khen,Bố nuôi,bé gái rơi từ tầng 12 chung cư', '<p><span style=\"font-size:16px\"><strong>Sau khi đỡ b&eacute; g&aacute;i 3 tuổi rơi từ tầng 12 chung cư ở H&agrave; Nội xuống, anh Nguyễn Ngọc Mạnh được mọi người xem như người h&ugrave;ng. Tuy nhi&ecirc;n, anh Mạnh mong được l&agrave;m một người b&igrave;nh thường để được gi&uacute;p người với một t&acirc;m thế v&ocirc; tư.</strong></span></p>\r\n', 65, 1, '2022-02-11 05:43:01', '2022-02-11 05:43:01'),
(32, 'Uzumaki Naruto', 'Những điều nên làm, kiêng kỵ ngày Tết theo phong tục dân gian để may mắn năm Nhâm Dần', 'nhung-dieu-nen-lam-kieng-ky-ngay-tet-theo-phong-tuc-dan-gian-de-may-man-nam-nham-dan', '69de5f5969.jpg', '<p><span style=\"font-size:16px\">D&ugrave; vẫn biết những điều được truyền miệng n&ecirc;n l&agrave;m hay&nbsp;<a href=\"https://thanhnien.vn/cach-cung-giao-thua-va-bay-mam-ngu-qua-vi-sao-la-cau-dua-du-xoai-post1426198.html\" title=\"Cách cúng giao thừa và bày mâm ngũ quả vì sao là \'cầu dừa đủ xoài\'\">kh&ocirc;ng n&ecirc;n ng&agrave;y Tết</a>&nbsp;c&oacute; nhiều điều phi l&yacute;, kh&ocirc;ng tin nhưng một số gia đ&igrave;nh Việt vẫn giữ nếp&nbsp;<a href=\"https://thanhnien.vn/thang-7-co-hon-va-nhung-thac-mac-thuc-hu-nhung-dieu-kieng-ki-post871867.html\" title=\"Tháng 7 ‘cô hồn’ và những thắc mắc thực hư những điều kiêng kị?\">ki&ecirc;ng kỵ</a>&nbsp;v&igrave; cho rằng &quot;đầu xu&ocirc;i đu&ocirc;i lọt&quot;, &quot;c&oacute; ki&ecirc;ng c&oacute; l&agrave;nh&quot;.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Theo một chuy&ecirc;n gia nghi&ecirc;n cứu t&ocirc;n gi&aacute;o thuộc ĐH Quốc gia TP.HCM, những tập tục n&agrave;y chủ yếu được truyền miệng phổ biến trong d&acirc;n gian, gi&aacute; trị ch&acirc;n l&yacute; của những điều n&agrave;y gần như kh&ocirc;ng thể kiểm định được.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"\" src=\"http://localhost/Projec%20PHP%20thu%E1%BA%A7n/Admin/ckeditor/Penguins.jpg\" style=\"height:768px; width:1024px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><a href=\"https://thanhnien.vn/the-gioi/nguoi-viet-nam-chau/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Người Việt\">Người Việt</a>&nbsp;vẫn tin rằng &quot;đầu xu&ocirc;i đu&ocirc;i lọt&quot;</p>\r\n\r\n			<div class=\"source\">\r\n			<p>ĐỘC LẬP</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Những điều n&ecirc;n l&agrave;m ng&agrave;y Tết theo&nbsp;<a href=\"https://thanhnien.vn/tap-tuc-ngay-tet-nguoi-viet-tia-chan-nhang-lau-don-ban-tho-the-nao-post1424501.html\" title=\"Tập tục ngày Tết người Việt: Tỉa chân nhang, lau dọn bàn thờ thế nào?\">tập tục d&acirc;n gian</a>:</span></p>\r\n\r\n<h2>Mua muối</h2>\r\n\r\n<p><span style=\"font-size:16px\">&quot;Đầu năm mua muối, cuối năm mua v&ocirc;i&quot;, c&acirc;u n&oacute;i từ l&acirc;u đ&atilde; trở n&ecirc;n quen thuộc. Người Việt xưa cho rằng muối c&oacute; thể trừ được t&agrave; ma, t&igrave;nh cảm mặn nồng. Do vậy, người Việt thường ra chợ v&agrave;o s&aacute;ng m&ugrave;ng 1 Tết mua muối để cầu mong trong c&aacute;c mối quan hệ đều được đậm đ&agrave;, mặn nồng.</span></p>\r\n\r\n<h2>Đi lễ ch&ugrave;a</h2>\r\n\r\n<p><span style=\"font-size:16px\">Trong ng&agrave;y m&ugrave;ng 1 Tết, người theo Phật gi&aacute;o c&oacute; th&oacute;i quen đi 10 cảnh ch&ugrave;a, từ thời khắc giao thừa đến gần hết ng&agrave;y m&ugrave;ng 1 c&oacute; người đi cả 15, 20 ng&ocirc;i ch&ugrave;a nếu&nbsp;<a href=\"https://thanhnien.vn/suc-khoe/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"sức khỏe\">sức khỏe</a>&nbsp;thời gian cho ph&eacute;p.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Ng&agrave;y đầu năm người ta thường đi ch&ugrave;a v&agrave; nghĩ đến những điều tốt đẹp cho nhau, cho đất nước, cho&nbsp;<a href=\"https://thanhnien.vn/the-gioi/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"thế giới\">thế giới</a>, cầu ch&uacute;c những điều an l&agrave;nh. Đạt được hay kh&ocirc;ng th&igrave; c&ograve;n t&ugrave;y thuộc v&agrave;o sự nỗ lực của c&aacute; nh&acirc;n v&agrave; tập thể.</span></p>\r\n\r\n<h2>H&aacute;i lộc</h2>\r\n\r\n<p><span style=\"font-size:16px\">Người Việt tin rằng, ng&agrave;y đầu năm đi l&ecirc;n ch&ugrave;a h&aacute;i lộc, l&igrave; x&igrave; lấy lộc cũng được coi l&agrave; những đồng tiền nền tảng cho sự nghiệp ch&acirc;n ch&iacute;nh. Đ&acirc;y như một lời kh&iacute;ch lệ nhắc nhở những người tiếp nhận hồng bao l&igrave; x&igrave; nỗ lực ch&acirc;n ch&iacute;nh, kh&ocirc;ng tin v&agrave;o sự may rủi, kh&ocirc;ng ph&oacute; mặc cuộc đời của m&igrave;nh cho sự cứu trợ của cuộc đời, kh&ocirc;ng n&ecirc;n c&oacute; thần linh chi phối. Mọi điều hạnh ph&uacute;c khổ đau, gi&agrave;u hay ngh&egrave;o l&agrave; do m&igrave;nh l&agrave;m ra.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Đi chùa đầu năm từ lâu đã thành thói quen của nhiều gia đình Việt\" src=\"ckeditor/chua5_sero_lvhg.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Đi ch&ugrave;a đầu năm từ l&acirc;u đ&atilde; th&agrave;nh th&oacute;i quen của nhiều gia đ&igrave;nh Việt</p>\r\n\r\n			<div class=\"source\">\r\n			<p>LHH</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Ngo&agrave;i ra, người Việt xưa vẫn tin rằng ng&agrave;y Tết cần đi ch&uacute;c Tết những người th&acirc;n quen hay mặc đồ m&agrave;u đỏ, m&agrave;u hồng để được may mắn cả năm. D&ugrave; vậy, thực tế ng&agrave;y nay, trong bối cảnh dịch&nbsp;<a href=\"https://thanhnien.vn/covid-19/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Covid-19\">Covid-19</a>, việc đi ch&uacute;c Tết cũng được một số gia đ&igrave;nh c&acirc;n nhắc; c&ograve;n chuyện mặc đồ m&agrave;u g&igrave; th&igrave; người ta chủ yếu hướng tới việc ph&ugrave; hợp hay kh&ocirc;ng, kh&ocirc;ng quan trọng m&agrave;u sắc.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Dưới đ&acirc;y l&agrave; những điều ki&ecirc;ng cữ của người Việt được truyền tai nhau:</span></p>\r\n\r\n<h2>Kỵ tang ma</h2>\r\n\r\n<p><span style=\"font-size:16px\">Theo quan niệm của người Việt, nh&agrave; n&agrave;o đang c&oacute; tang th&igrave; kh&ocirc;ng đi ch&uacute;c Tết gia đ&igrave;nh kh&aacute;c, m&agrave; chỉ ở nh&agrave; đ&oacute;n kh&aacute;ch đến ch&uacute;c Tết. Người Việt tin rằng người c&oacute; tang đi ch&uacute;c Tết gia đ&igrave;nh kh&aacute;c sẽ ảnh hưởng đến niềm vui chung của Tết.</span></p>\r\n\r\n<h2>Ki&ecirc;ng mặc quần &aacute;o m&agrave;u trắng hoặc đen</h2>\r\n\r\n<p><span style=\"font-size:16px\">D&acirc;n gian cho rằng m&agrave;u trắng, m&agrave;u đen l&agrave; m&agrave;u của tang ma n&ecirc;n tr&aacute;nh mặc m&agrave;u n&agrave;y v&agrave;o ng&agrave;y Tết. D&ugrave; vậy, ng&agrave;y nay m&agrave;u trắng v&agrave; m&agrave;u đen l&agrave; hai m&agrave;u được nhiều người ưa chuộng v&igrave; sự tối giản, dễ phối đồ, kh&ocirc;ng k&eacute;n người mặc. V&igrave; vậy, tập tục n&agrave;y đang dần mai một.</span></p>\r\n\r\n<h2>Ki&ecirc;ng qu&eacute;t nh&agrave;, đổ r&aacute;c trong ng&agrave;y Tết</h2>\r\n\r\n<p><span style=\"font-size:16px\">Nhiều người truyền miệng với nhau, 3 ng&agrave;y Tết m&agrave; qu&eacute;t nh&agrave; th&igrave; may mắn, t&agrave;i lộc đầu năm sẽ tr&ocirc;i ra khỏi nh&agrave;. Do đ&oacute; m&agrave; chiều 30 Tết, c&aacute;c gia đ&igrave;nh thường dọn dẹp sạch sẽ để m&ugrave;ng 1, m&ugrave;ng 2 v&agrave; m&ugrave;ng 3 kh&ocirc;ng phải dọn dẹp. Nếu c&oacute; qu&eacute;t nh&agrave;, người Việt thường qu&eacute;t tấp v&agrave;o một g&oacute;c nh&agrave;, chờ qua đủ 3 ng&agrave;y Tết hoặc tới ng&agrave;y c&uacute;ng đưa &ocirc;ng b&agrave; mới bắt đầu hốt đi đổ.</span></p>\r\n\r\n<h2>Ki&ecirc;ng l&agrave;m vỡ đồ đạc</h2>\r\n\r\n<div id=\"Advert_Product\">&nbsp;</div>\r\n\r\n<p><span style=\"font-size:16px\">Một số gia đ&igrave;nh Việt ng&agrave;y nay vẫn cho rằng ch&eacute;n b&aacute;t, ly t&aacute;ch hay đồ s&agrave;nh sứ m&agrave; bị vỡ bể, sứt mẻ trong những ng&agrave;y đầu năm th&igrave; đ&oacute; l&agrave; dấu hiệu của &quot;điềm xui rủi&quot;, gia đ&igrave;nh dễ c&oacute; những chuyện rạn nứt, bất h&ograve;a trong năm mới.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Kh&ocirc;ng chỉ Tết, m&agrave; với những ng&agrave;y trong năm, nhiều người cũng cho rằng khi ly ch&eacute;n bể th&igrave; đ&oacute; l&agrave; dấu hiệu c&oacute; những điều kh&ocirc;ng hay sắp xảy đến.</span></p>\r\n\r\n<h2>Ki&ecirc;ng n&oacute;i to, c&atilde;i nhau</h2>\r\n\r\n<p><span style=\"font-size:16px\"><a href=\"https://thanhnien.vn/tet-nguyen-dan/\" rel=\"noopener noreferrer\" target=\"_blank\" title=\"Tết Nguyên Đán\">Tết Nguy&ecirc;n Đ&aacute;n</a>&nbsp;l&agrave; dịp cả gia đ&igrave;nh được qu&acirc;y quần sum họp b&ecirc;n nhau, gia đ&igrave;nh n&agrave;o cũng mong muốn kh&ocirc;ng kh&iacute; đầm ấm, hạnh ph&uacute;c như vậy được duy tr&igrave; xuy&ecirc;n suốt cả năm.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Những chậu hoa màu sắc rực rỡ được kỳ vọng cho năm mới khởi sắc\" src=\"ckeditor/binh-dong5-9896.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Những chậu hoa m&agrave;u sắc rực rỡ được kỳ vọng cho năm mới khởi sắc</p>\r\n\r\n			<div class=\"source\">\r\n			<p>ĐỘC LẬP</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">Do đ&oacute;, người Việt cho rằng, d&ugrave; c&oacute; thế n&agrave;o th&igrave; cả năm chỉ c&oacute; mấy ng&agrave;y Tết mọi người phải vui vẻ để tạo bầu kh&ocirc;ng kh&iacute; của ng&agrave;y Xu&acirc;n.</span></p>\r\n\r\n<h2>Ki&ecirc;ng ăn thịt ch&oacute;, vịt, chuối, trứng vịt lộn</h2>\r\n\r\n<p><span style=\"font-size:16px\">Tập tục người Việt quan niệm những m&oacute;n ăn n&agrave;y gắn liền với những điều kh&ocirc;ng may n&ecirc;n kh&ocirc;ng chỉ ki&ecirc;ng cữ ng&agrave;y Tết m&agrave; ngay cả những ng&agrave;y đầu th&aacute;ng &acirc;m lịch người ta cũng ki&ecirc;ng ăn.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Ri&ecirc;ng &quot;chuối&quot; th&igrave; do c&aacute;ch ph&aacute;t &acirc;m của người miền Nam m&agrave; chuối đọc th&agrave;nh &quot;ch&uacute;i&quot; mang &yacute; &quot;ch&uacute;i rủi&quot; - l&agrave;m mọi việc thất bại, đi xuống hoặc c&ograve;n hiểu l&agrave; trượt vỏ chuối n&ecirc;n người ta ki&ecirc;ng cữ.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">C&ograve;n trứng vịt lộn người miền Bắc ki&ecirc;ng ăn đầu th&aacute;ng nhưng với người miền Nam th&igrave; trứng vịt lộn lại l&agrave; m&oacute;n ăn giải xui phổ biến.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Ngo&agrave;i ra, người Việt c&ograve;n truyền tai nhau rất nhiều điều ki&ecirc;ng cữ ng&agrave;y Tết như: ki&ecirc;ng xuất h&agrave;nh v&agrave;o ng&agrave;y mồng 5, ki&ecirc;ng từ chối ăn uống khi đi ch&uacute;c Tết, những đứa trẻ đi chơi thường phải về trước giao thừa để tr&aacute;nh l&agrave; người đạp đất,...</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Thượng tọa Th&iacute;ch Nhật Từ, trụ tr&igrave; ch&ugrave;a Gi&aacute;c Ngộ (TP.HCM) cũng cho biết, mọi điều ki&ecirc;ng kỵ theo Phật gi&aacute;o phần lớn l&agrave; m&ecirc; t&iacute;n, Phật gi&aacute;o kh&ocirc;ng kh&iacute;ch lệ h&igrave;nh thức đ&oacute;.</span></p>\r\n\r\n<table align=\"center\" class=\"picture\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Những điều kiêng kỵ được truyền tai nhau có nhiều điều phi lý, nhưng vẫn được một số gia đình lưu truyền\" src=\"ckeditor/binh-dong17-2827.jpg\" style=\"width:637px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>Những điều ki&ecirc;ng kỵ được truyền tai nhau c&oacute; nhiều điều phi l&yacute;, nhưng vẫn được một số gia đ&igrave;nh lưu truyền</p>\r\n\r\n			<div class=\"source\">\r\n			<p>ĐỘC LẬP</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:16px\">&quot;Người ta truyền tai nhau ki&ecirc;ng qu&eacute;t r&aacute;c ng&agrave;y đầu năm, quan niệm r&aacute;c l&agrave; biểu tượng cho tiền, qu&eacute;t r&aacute;c ra khỏi nh&agrave; tức l&agrave; qu&eacute;t tiền t&agrave;i l&agrave; rất v&ocirc; l&yacute;. R&aacute;c l&agrave; những thứ l&agrave;m con người giảm đi gi&aacute; trị sức khỏe, mất thẩm mỹ, chướng ngại trong việc di chuyển, sinh hoạt trong gia đ&igrave;nh. Kh&ocirc;ng biết từ đ&acirc;u người ta lại biến n&oacute; th&agrave;nh biểu tượng của tiền, người ta nghĩ rằng khi qu&eacute;t r&aacute;c ra khỏi nh&agrave; l&agrave; đẩy tiền ra b&ecirc;n ngo&agrave;i&quot;, Thượng tọa trụ tr&igrave; ch&ugrave;a Gi&aacute;c Ngộ n&ecirc;u &yacute; kiến.</span></p>\r\n\r\n<p><span style=\"font-size:16px\">Theo Thượng tọa Th&iacute;ch Nhật Từ, ở trong c&aacute;c ch&ugrave;a chẳng những kh&ocirc;ng hề t&aacute;n đồng cho th&oacute;i quen ki&ecirc;ng kỵ, m&ecirc; t&iacute;n đ&oacute;, m&agrave; ngược lại từ Tết tới Rằm th&aacute;ng Gi&ecirc;ng mỗi ng&agrave;y phải qu&eacute;t nhiều lần, ng&agrave;y m&ugrave;ng 1 Tết l&agrave; qu&eacute;t nhiều lần nhất. Đối với ng&ocirc;i ch&ugrave;a n&agrave;o c&oacute; lượng du kh&aacute;ch đ&ocirc;ng, ngo&agrave;i qu&eacute;t thường xuy&ecirc;n nhiều lần c&ograve;n phải r&uacute;t ch&acirc;n nhang, qu&eacute;t bụi nhang nhiều lần. Thậm ch&iacute;, ngo&agrave;i việc đ&oacute; c&ograve;n phải n&eacute;n tro nhang rớt trong lư hương kh&ocirc;ng bị gi&oacute; bay l&ecirc;n. Do vậy, Thượng tọa Th&iacute;ch Nhật Từ mong người Việt hiểu được điều g&igrave; n&ecirc;n l&agrave;m, điều g&igrave; kh&ocirc;ng n&ecirc;n l&agrave;m để mạnh dạn từ bỏ.</span></p>\r\n', 0, 'kiêng kỵ ngày Tết,kiêng kỵ,những điều nên làm,Tết Nhâm Dần,vì sao kiêng quét nhà,tập tục ngày Tết,Người Việt', '<p><span style=\"font-size:16px\"><strong>Ng&agrave;y Tết Nh&acirc;m Dần, một số gia đ&igrave;nh Việt lại truyền tai nhau những điều n&ecirc;n l&agrave;m v&agrave; ki&ecirc;ng kỵ ng&agrave;y Tết với mong muốn cả năm gặp nhiều may mắn, b&igrave;nh an. Đ&oacute; l&agrave; g&igrave;?&nbsp;</strong></span></p>\r\n', 66, 1, '2022-02-11 05:59:59', '2023-01-11 05:21:13');
